import { VALIDATE_PAYER } from "../actions/action-types";

const payerState = {
    errCount:0,
    name: null,
    tin: null,
    street: null,
    city: null,
    state: null,
    zipcode: null,
    phone: null,
}

export default function payerReducer(state = payerState, action) {
    switch( action.type ) {
        case VALIDATE_PAYER: 
            return action.payload 

        default:
            return state;
    }
};
